import React from 'react';

const ExpenseForm = () => {
  return (
    <form>
      <div>
        <div>
          <label>Title</label>
          <input type="text" />
        </div>
        <div>
          <label htmlFor="">Amount</label>
          <input type="number" />
        </div>
        <div>
          <label htmlFor="">Date</label>
          <input type="date" min='2021-01-01' max='2023-12-31'/>
        </div>
      </div>
      <div>
          <button type="submit">Add Expense</button>
        </div>

    </form>
  );
};

export default ExpenseForm;
